import React, { useState } from 'react';
import Gallery from './galleryArt.json';
import Like from './Liked';

const SearchFilter = () => {
  const [selected, setSelected] = useState(Gallery);

  const filterMedium = (category) => {
    const update = Gallery.filter((button) => button.medium === category);
    setSelected(update);
  };

  const handleLike = (artwork) => {
    setSelected((prevSelected) =>
      prevSelected.map((item) => {
        if (item.artwork === artwork) {
          return { ...item, liked: !item.liked };
        } else {
          return item;
        }
      })
    );
  };

  return (
    <main className="main-filter">
      <h1 className="filter-title heading color-change">Gallery</h1>
      <h2 className="filter-title art">
        Search <span className="line-art">art </span>by{' '}
        <span className="line-art">medium</span>.
      </h2>
      <section id="medium-container" role="menu">
        <button
          id="Paint"
          className="btn filter-btn"
          onClick={() => filterMedium('Paint')}
        >
          PAINT
        </button>
        <button
          id="Mixed Media"
          className="btn filter-btn"
          onClick={() => filterMedium('Mixed Media')}
        >
          MIXED MEDIA
        </button>
        <button
          id="Chromolithography"
          className="btn filter-btn"
          onClick={() => filterMedium('Chromolithography')}
        >
          CHROMOLITHOGRAPHY
        </button>
        <button
          id="Sculpture"
          className="btn filter-btn"
          onClick={() => filterMedium('Sculpture')}
        >
          SCULPTURE
        </button>
        <button
          id="Acrylics"
          className="btn filter-btn"
          onClick={() => filterMedium('Print')}
        >
          PRINT
        </button>
        <button
          id="Water Color"
          className="btn filter-btn"
          onClick={() => filterMedium('Water Color')}
        >
          WATER COLOR
        </button>
        <button
          id="ShowAll"
          className="btn filter-btn"
          onClick={() => setSelected(Gallery)}
        >
          SHOW ALL
        </button>
      </section>

      {/* this is the search gallery for all the art-----------------------------------------------------------------*/}
      <div className="gallery-card-container">
        {selected.map((item) => (
          <div className="gallery-card" aria-label="Card for artwork" key={item.title}>
            {/* for images */}
            <div className="img-div">
              <img src={item.artwork} alt={item.title} className="img-fluid" aria-label="Image of artwork" />
            </div>
            {/* label for gallery item */}
            <p className="gallery-card-title" aria-label="Title of art piece">
              {item.title}
              {item.liked ? (
                <i className="fas fa-heart" style={{ color: 'pink' }} onClick={() => handleLike(item.artwork)}></i>
              ) : (
                <i className="far fa-heart" onClick={() => handleLike(item.artwork)}></i>
              )}
            </p>
            <p className="gallery-card-medium" aria-label="Medium of art piece">
              {item.medium}
            </p>
            <p className="gallery-card-medium" aria-label="Seller of art piece">
              Seller: {item.seller}
            </p>
            item.liked && <Like artwork={item.artwork} handleLike={handleLike} liked={item.liked} /> </div>
))}
</div>

  </main>
);
};
export default SearchFilter;
